import React from "react";
import "./Testimonials.css";
import img1 from  "./img1.jpeg";
import img2 from  "./img2.jpeg";
import img3 from  "./img3.jpeg";
const Testimonials = () => {
  return (
    <div className="flexy">
    <figure className="snip">
  <blockquote>In January of 2014 I started volunteering at ARF. It was the greatest decision of my life!  I mentioned that if they ever got a tuxedo with a white-tipped tail, I would want him. Two weeks later, Piglet, now known as Roscoe, showed up. What a guy he turned out to be. He follows me all over the house, greets me at the door with a “meow” when I come home, and snuggles in bed sometimes, and I would not have it any other way. He settled in with my nine other indoor cats, all rescues, very easily! </blockquote>
  <div className="author">
    <img src={img3} alt="sq-sample1"/>
    <h5>Pelican Steve <span> Dog lover</span></h5>
  </div>
</figure>
<figure className="snip hover">
  <blockquote>I had the most wonderful experience adopting a dog from ARF this summer. Biscuit is a year-old terrier mix and the absolute sweetest girl, and she came house-trained, too. Everyone who sees her loves her, and she has settled in perfectly to New York City life with weekends in the country. She loves my two cats, although it’s not entirely mutual! I can’t say enough about ARF. They have an experienced, caring staff, and I highly recommend this rescue organization without reservation!</blockquote>
  <div className="author">
    <img src={img2} alt="sq-sample24"/>
    <h5>Max Conversion<span> Cat Lover</span></h5>
  </div>
</figure>
<figure className="snip">
  <blockquote>Thank you for the wonderful experience of adopting Daisy. She has been wonderful. She settled into our journey across the States like a pro, as if she were part of us from the very beginning. Just wanted to let you know that we are truly grateful for how well cared for she was and how much she will be loved here. Lots of hugs! At first, CeCe was a little bit nervous and shy. I knew that was normal because it was a new place. I paid lots of attention to her. After a few days, she understood that I wanted to take care of her, and she started to be close to me.</blockquote>
  <div className="author">
    <img src={img1} alt="sq-sample29"/>
    <h5>Eleanor Faint<span> Animal Lover</span></h5>
  </div>
</figure>
<figure className="snip">
  <blockquote>Over the last two years we’ve learned a lot from Beaker (like why he was named Rocket while at ARF!). We’ve certainly had some challenges, but he has made tremendous progress and has taught us to be more patient and to enjoy the small things in life. We couldn’t be happier! Beaker is a great companion, whether we’re running, hiking, or just sitting at home. We can’t imagine our lives without him! Thank you for bringing him into our lives. </blockquote>
  <div className="author">
    <img src={img3} alt="sq-sample1"/>
    <h5>Pelican Steve <span> Dog lover</span></h5>
  </div>
</figure>
</div>
  );
};

export default Testimonials;
